Exercise.create!([
  {name: "Decline Barbell Bench", description: "The decline barbell bench press targets the lower chest, triceps, and shoulders. Perform it on a bench angled downward, lowering the barbell to your lower chest and pressing it back up.", image_url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT8jZthbDPYi00wXKcCvXeODpUSXZXQEfHVGQ&s", video_url: "https://www.youtube.com/watch?v=iVh4B5bJ5OI", category: "Chest"},
  {name: "Dumbbell Curl", description: "The dumbbell curl targets the biceps. Stand with a dumbbell in each hand, palms facing forward, and curl the weights toward your shoulders, then lower them back down with control.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=CFBZ4jN1CMI", category: "Arms"},
  {name: "Squat", description: "The squat is a lower-body strength exercise where a person bends their knees and lowers their hips, then returns to a standing position, targeting the thighs, hips, and glutes.", image_url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRH77X0ZS62ergiaP8-7bo9T8d4L9a-w5vwqg&s", video_url: "https://www.youtube.com/watch?v=ultWZbUMPL8", category: "Legs"},
  {name: "Lunges", description: "A lower-body exercise targeting the quads, glutes, and hamstrings.", image_url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSdGbJpXExTMiYwPl_LcWC8Eo-26NwuPnCnlw&s", video_url: "https://www.youtube.com/watch?v=L8fvypPrzzs", category: "Legs"},
  {name: "Pull-up", description: "A bodyweight exercise that targets the back, shoulders, and arms.", image_url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS8RIoJljrEQpZu8Uxo9ozvzcNwM_x3FVZv3w&s", video_url: "https://www.youtube.com/watch?v=aAggnpPyR6E", category: "Back"},
  {name: "Deadlift", description: "A compound movement targeting the lower back, glutes, hamstrings, and core.", image_url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ_1Tb0f7scqTAOg2DdeATrnvK-yRLQF6M5Hw&s", video_url: "https://www.youtube.com/watch?app=desktop&v=op9kVnSso6Q", category: "Legs"},
  {name: "Dips", description: "A bodyweight exercise that targets the chest, triceps, and shoulders.", image_url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRpj2DPi3c6XL2Wjy9gbqmtrpudsYc5apj9vQ&s", video_url: "https://www.youtube.com/watch?v=yPxPSG_LLUY", category: "Arms"},
  {name: "Bent-over Row", description: "Focuses on the back, biceps, and shoulders.", image_url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQqOs_e2DM2W8lzYsxuTp7IuD85jWS0ddfyGQ&s", video_url: "https://www.youtube.com/watch?v=GIqICKwpUHw", category: "Back"},
  {name: "Skull Crushers", description: "A triceps-focused exercise performed with an EZ bar or dumbbells.", image_url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT4Ot3MDPE9HkslAWe932WrT8afT-KcapC0CA&s", video_url: "https://www.youtube.com/watch?v=D47mYdoKllE", category: "Arms"},
  {name: "Chest Fly", description: "Targets the chest muscles (pectorals) and can be done using dumbbells or a machine.", image_url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSez9Spp_1QbGnjxa3e1XfH0nWrMwle2TtFGQ&s", video_url: "https://www.youtube.com/watch?v=Nhvz9EzdJ4U", category: "Chest"},
  {name: "Overhead Press", description: "A shoulder exercise that also engages the triceps and upper chest.", image_url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRn-6sPASUueC3m16jju-i_BVrc1-V_GZxVIA&s", video_url: "https://www.youtube.com/watch?v=5yWaNOvgFCM", category: "Shoulders"},
  {name: "Dumbbell Bench Press", description: "The dumbbell bench press targets the chest, shoulders, and triceps. Lie on a flat bench, press dumbbells up from chest level, and lower them back in a controlled motion.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=X3YrlBmjWrY", category: "Chest"},
  {name: "Incline Dumbbell Press", description: "The incline dumbbell press targets the upper chest, shoulders, and triceps. Lie on an incline bench, press dumbbells upward from your chest, and lower them back down.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=oZVCBM9f8Eo", category: "Chest"},
  {name: "Decline Dumbbell Press", description: "The decline dumbbell press targets the lower chest, shoulders, and triceps. Lie on a decline bench, press dumbbells upward from your lower chest, and lower them back down.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=0xRvl4Qv3ZY", category: "Chest"},
  {name: "Dumbbell Flys", description: "The dumbbell flys target the chest muscles with a focus on stretching. Lie on a flat, incline, or decline bench, extend dumbbells outward in an arc, and bring them together above your chest.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=eozdVDA78K0", category: "Chest"},
  {name: "Cable Chest Flys", description: "The cable chest flys target the chest by using a cable machine. Stand with cables in each hand, extend arms out to the sides, and bring them together in front of your chest, keeping a slight bend in the elbows.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=WEM9FCIPlxQ", category: "Chest"},
  {name: "Low to High Cable Chest Fly", description: "The low-to-high cable chest fly targets the upper chest. Stand with cables set low, pull the handles upward and together in an arc, bringing them to chest height while keeping a slight bend in the elbows.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=M1N804yWA-8", category: "Chest"},
  {name: "High to Low Cable Chest Fly", description: "\nThe high-to-low cable chest fly targets the lower chest. Stand with cables set high, pull the handles downward and together in an arc, bringing them to waist or lower chest height while keeping a slight bend in the elbows.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=2-YJQCvWcv4", category: "Chest"},
  {name: "Machine Chest Press", description: "\nThe machine chest press targets the chest, shoulders, and triceps. Sit on the machine, grip the handles, and push them forward until your arms are extended, then slowly return to the starting position.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=n8TOta_pfr4", category: "Chest"},
  {name: "Preacher Curl", description: "\nThe preacher curl isolates the biceps. Sit at a preacher bench, grip the barbell or machine handles, and curl the weight up toward your shoulders, then lower it back down with control.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=k1Eg7QpNcC4", category: "Arms"},
  {name: "Barbell Bicep Curl", description: "The barbell bicep curl targets the biceps. Stand with a barbell, grip it shoulder-width apart, and curl it up toward your chest, keeping your elbows close to your body, then slowly lower it back down.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=kwG2ipFRgfo", category: "Arms"},
  {name: "Single Arm Cable Tricep Pushdown", description: "The single-arm cable tricep pulldown targets the triceps. Stand facing the cable machine, grip the handle with one hand, pull it down toward your thigh while keeping your elbow stationary, then slowly return to the starting position.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=Cp_bShvMY4c", category: "Arms"},
  {name: "Hammer Curl", description: "The hammer curl targets the biceps and forearms. Hold a dumbbell in each hand with palms facing your torso, curl the weights up while keeping your palms facing each other, then lower them back down.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=CFBZ4jN1CMI", category: "Arms"},
  {name: "Cable Bicep Curl", description: "The cable bicep curl targets the biceps using a cable machine. Stand facing the machine, grip the cable handle with both hands, and curl the handle toward your shoulders, then slowly return to the starting position.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=zW73Nkodv0E", category: "Arms"},
  {name: "Machine Bicep Curl", description: "The machine bicep curl isolates the biceps. Sit at the machine, grip the handles or pads, and curl the weight towards your shoulders, then slowly lower it back down with control.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=F33L5PuiCH8", category: "Arms"},
  {name: "Close Grip Tricep Barbell Press", description: "The close-grip barbell bench press targets the triceps, chest, and shoulders. Lie on a bench, grip the barbell with hands shoulder-width apart, lower it to your chest, then press it back up while keeping your elbows close to your body.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=XEFDMwmrLAM", category: "Arms"},
  {name: "Overhead Dumbbell Tricep Press", description: "The overhead tricep dumbbell press targets the triceps. Sit or stand, hold a dumbbell with both hands overhead, and lower it behind your head by bending your elbows, then press it back up to the starting position.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=dxdr8iSRLA8", category: "Arms"},
  {name: "Rope Tricep Extension", description: "The rope tricep extension targets the triceps. Stand facing the cable machine, grip the rope attachment with both hands, and extend your arms downward, separating the rope at the bottom while squeezing your triceps, then return to the starting position.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=zoU-NBo1OI8", category: "Arms"},
  {name: "Tricep Push Down Machine", description: "The tricep pushdown machine targets the triceps. Sit at the machine, grip the handles, and push them downward by extending your arms fully, then slowly return to the starting position.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=OChuGyCSC7U", category: "Arms"},
  {name: "Dumbbell Lateral Raise", description: "The dumbbell lateral raise targets the side deltoids. Hold a dumbbell in each hand at your sides, lift the weights outward to shoulder height with a slight bend in your elbows, then lower them back down.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=XPPfnSEATJA", category: "Shoulders"},
  {name: "Shoulder Overhead Dumbbell Press", description: "The overhead dumbbell press targets the shoulders, triceps, and upper chest. Sit or stand, hold a dumbbell in each hand at shoulder height, and press them overhead until your arms are fully extended, then lower them back down.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=0JfYxMRsUCQ", category: "Shoulders"},
  {name: "Dumbbell Front Raise", description: "The dumbbell front raise targets the front deltoids. Hold a dumbbell in each hand in front of your thighs, lift the weights straight up to shoulder height with a slight bend in your elbows, then lower them back down.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=hRJ6tR5-if0", category: "Shoulders"},
  {name: "Dumbbell Rear Delt Fly", description: "The dumbbell rear delt fly targets the rear deltoids. Hold a dumbbell in each hand, bend forward at the waist, and with a slight bend in your elbows, raise the dumbbells outward until your arms are parallel to the floor, then lower them back down.", image_url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQy7tmURUra_56qC_UyWUjuD6YEMjw9tONB-g&s", video_url: "https://www.youtube.com/watch?v=EA7u4Q_8HQ0", category: "Shoulders"},
  {name: "Dumbbell Shrug", description: "The dumbbell shrug targets the traps. Hold a dumbbell in each hand at your sides, raise your shoulders toward your ears, hold briefly, then lower them back down.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=8lP_eJvClSA", category: "Shoulders"},
  {name: "Cable Lateral Raise", description: "The cable lateral raise targets the side deltoids. Stand sideways to the cable machine, hold the cable handle with the hand farthest from the machine, and lift the handle outward to shoulder height, then lower it back down with control.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=Z5FA9aq3L6A", category: "Shoulders"},
  {name: "Cable Lat Pull Down", description: "The cable lat pulldown targets the lats and upper back. Sit at the machine, grip the bar wider than shoulder-width, pull the bar down toward your chest, then slowly return it to the starting position.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=lueEJGjTuPQ", category: "Back"},
  {name: "Single Arm Dumbbell Bent Over Row", description: "The single-arm dumbbell bent-over row targets the upper and middle back. Place one knee and hand on a bench for support, hold a dumbbell in the other hand, and row the weight toward your hip while keeping your back flat, then lower it back down.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=fCoelKTw8BM", category: "Back"},
  {name: "Cable Face Pulls", description: "The cable face pull targets the rear delts and upper back. Stand facing the cable machine, grip the rope attachment with both hands, and pull the rope towards your face, keeping your elbows high, then slowly return to the starting position.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=0Po47vvj9g4", category: "Back"},
  {name: "Straight Arm Cable Pulldown", description: "The straight-arm cable pulldown targets the lats and upper back. Stand facing the cable machine, grip the bar with both hands, and pull the bar down toward your thighs with straight arms, then slowly return to the starting position.", image_url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTmrdWpHBrNnBwJcMWdiTAXGgH-D5S7PmlvAQ&s", video_url: "https://www.youtube.com/watch?v=wcVDItawocI", category: "Back"},
  {name: "Machine Pull Down Lat", description: "The machine lat pulldown targets the lats and upper back. Sit at the machine, grip the bar wider than shoulder-width, pull the bar down toward your chest, then slowly return it to the starting position.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=kwJeh3QyhVE", category: "Back"},
  {name: "Chest Supported Seated Row Machine", description: "The chest-supported seated row machine targets the upper and middle back. Sit on the machine with your chest against the pad, grip the handles, and pull them towards your torso, squeezing your shoulder blades together, then slowly return to the starting position.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=bmWA2yO9Aa0", category: "Back"},
  {name: "Planks", description: "The plank targets the entire core. Hold your body in a straight line, supported on your forearms and toes, while keeping your abs tight and your back flat.", image_url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTRg34zQJtuVmaSYJPjWoFxaj43mHACWBim-A&s", video_url: "https://www.youtube.com/watch?v=pSHjTRCQxIw", category: "Abs"},
  {name: "Bench Press", description: "The bench press is a strength training exercise that involves lying on a bench and pressing a weighted barbell or dumbbells upward from chest level, primarily targeting the chest, shoulders, and triceps.", image_url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSht1w_kuhsbWD5km6h9OmrTaB09LgxRWdO0g&s", video_url: "https://www.youtube.com/watch?v=SCVCLChPQFY", category: "Chest"},
  {name: "Incline Barbell Bench Press", description: "The incline barbell bench press targets the upper chest, shoulders, and triceps. Perform it on a bench angled at 30-45 degrees, lowering the barbell to your upper chest and pressing it back up.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?app=desktop&v=5k_enq6vXGM", category: "Chest"},
  {name: "Concentration Curl", description: "The concentration curl isolates the biceps. Sit on a bench, hold a dumbbell in one hand, rest your elbow on your inner thigh, and curl the weight toward your shoulder, then lower it back down slowly.", image_url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR7nTaK1I-YMggGoErqu45nvwHeoq4fr3VXCA&s", video_url: "https://www.youtube.com/watch?v=Jvj2wV0vOYU", category: "Arms"},
  {name: "Side Crunches", description: "The side crunch targets the obliques. Lie on your side with knees slightly bent, place your top hand behind your head, and lift your upper body toward your hips, then lower back down.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=q0QyCrpiNgI", category: "Abs"},
  {name: "Bicycle Crunches", description: "The bicycle crunch targets the abs and obliques. Lie on your back, alternate bringing one elbow toward the opposite knee while extending the other leg straight, mimicking a pedaling motion.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=lQ76ehxls3c", category: "Abs"},
  {name: "Side Plank", description: "The side plank targets the obliques and core. Lie on your side, lift your body off the ground, balancing on your forearm and the side of your foot, keeping your body in a straight line.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=2W96p2PIoPg", category: "Abs"},
  {name: "Windshield Wipers", description: "The windshield wipers target the obliques and lower abs. Lie on your back with arms outstretched, lift your legs to a 90-degree angle, and rotate them side to side in a controlled motion like a windshield wiper.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=SQMAuU7LvkI", category: "Abs"},
  {name: "Leg Raises", description: "The leg raise targets the lower abs. Lie on your back with legs straight, lift them toward the ceiling until they form a 90-degree angle, then slowly lower them back down without touching the floor.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=xJJu-WiROM8", category: "Abs"},
  {name: "Tuck Ups", description: "The tuck-up targets the entire core. Lie on your back with legs extended and arms overhead, then simultaneously lift your upper body and knees toward each other, tucking into a V-shape, before returning to the starting position.", image_url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSkyHclYVvnsfp83CPTGvkNzG9nEyPUvqoqkA&s", video_url: "https://www.youtube.com/watch?v=xK1qivDCvp4", category: "Abs"},
  {name: "V Ups", description: "The V-up targets the upper and lower abs. Lie on your back with legs straight and arms overhead, then lift your upper body and legs simultaneously, reaching your hands toward your toes to form a V-shape, before lowering back down.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=nz7gg31axKE", category: "Abs"},
  {name: "Hanging Leg Raise", description: "The hanging leg raise targets the lower abs. Hang from a pull-up bar with arms extended, then lift your legs straight up until they are parallel to the floor or higher, and slowly lower them back down.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=Nw0LOKe3_l8", category: "Abs"},
  {name: "Leg Press", description: "The leg press targets the quads, hamstrings, and glutes. Sit on the leg press machine, place your feet shoulder-width apart on the platform, push the platform upward by extending your legs, then slowly lower it back down without locking your knees.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=W7y2OcOmxYU", category: "Legs"},
  {name: "Barbell Hip Thrust", description: "The barbell hip thrust targets the glutes and hamstrings. Sit on the floor with your upper back against a bench, roll a barbell over your hips, and thrust your hips upward until your body forms a straight line from shoulders to knees, then lower back down.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=3ENrRyaAFEQ", category: "Legs"},
  {name: "Glute Bridge Machine", description: "The glute bridge machine targets the glutes and hamstrings. Sit at the machine with your upper back against the pad, position the resistance bar across your hips, and push your hips upward until your body forms a straight line, then lower back down with control.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=UVucPKyQVLU", category: "Legs"},
  {name: "Hamstring Curl Machine", description: "The hamstring curl machine targets the hamstrings. Sit or lie on the machine (depending on the type), position your legs under the padded lever, and curl it downward toward your body, then slowly return to the starting position.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=1Tq3QdYUuHs", category: "Legs"},
  {name: "Calf Raise Machine", description: "The calf raise machine targets the calves. Position your shoulders under the pads (standing machine) or sit with feet on the platform (seated machine), push through the balls of your feet to raise your heels as high as possible, then lower back down with control.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=VIUg0nNw5BE", category: "Legs"},
  {name: "Hack Squat Machine", description: "The hack squat machine targets the quads, hamstrings, and glutes. Stand on the platform with your back against the pad, shoulders under the supports, lower your body by bending your knees, then push through your heels to return to the starting position.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=0tn5K9NlCfo", category: "Legs"},
  {name: "Quad Curl Machine", description: "The leg extension machine targets the quads. Sit on the machine with your legs under the padded lever, adjust the pad to sit on your lower legs, and extend your legs straight out, then slowly lower the weight back to the starting position.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=swZQC689o9U", category: "Legs"},
  {name: "Dumbbell Side Lunge", description: "The dumbbell side lunge targets the quads, glutes, and inner thighs. Hold a dumbbell in each hand, step out to the side with one leg, bending the knee and lowering your hips toward the floor, then push through the heel to return to the starting position and repeat on the other side.", image_url: "data:image/jpeg;base64,", video_url: "https://www.youtube.com/watch?v=gKcUhmLbEIY", category: "Legs"},
